import React, { Component } from 'react';
import {Radio} from 'evergreen-ui';

class Origin extends Component {
  constructor(props) {
    super(props);

    this.state = {
      origin: "bottom_left",
    }
  }

  render() {
    return (
      <div>
        <Radio name="top_left" checked />
        <Radio name="top_right" checked />
        <Radio name="center" checked />
        <Radio name="bottom_left" checked />
        <Radio name="bottom_right" checked />
      </div>
    );
  }
}

export {Origin};
